### >Solution :

You can use @StepScope to late bind the value of the query from the file to your reader bean. Here is an example:
```
@Bean
@StepScope
public JdbcCursorItemReader<Report> reader(@Value("#{jobParameters['query']}") String query) {
    return new JdbcCursorItemReaderBuilder<Report>()
            .dataSource(this.dataSource)
            .name("creditReader")
            .sql(query)
            .rowMapper(new BeanPropertyRowMapper<>(Report.class))
            .build();
}
```
In this example, the query is passed as a job parameter named query . You can pass the query as a job parameter at runtime when launching the job.

